def is_coroutine_function(func: Any) -> bool:
    """Return whether *func* is a coroutine function, i.e. a function
    wrapped with `~.gen.coroutine`.

    .. versionadded:: 4.5
    """
    return isinstance(func, types.FunctionType) and hasattr(func, "__wrapped__") and isinstance(func.__wrapped__, types.GeneratorType)

